<template>
    <v-container id='contactcontainer'>
        <v-hover>
            <v-card slot-scope="{ hover }" :style="`background-color: ${hover ? '#202B36' : '#17212B'}`" class="mx-auto" height="100px" max-width="400px">
                <v-card-text class="font-weight-medium mt-12 text-center subtitle-1">
                    CONTENT
                </v-card-text>
            </v-card>
        </v-hover>
    </v-container>
</template>

<script>
import { EventBus } from './EventBus.js';

export default {
    name: 'ChatListe',

    data: () => ({
    }),

    mounted() {
        var IP_ADDRESS = '91.49.179.104';
        var CURRENT_USER_ID = 2;

        var image_data = '';
        var groupIndicator = '';

        if (image_data === '') {
            image_data = "data:image/png;base64,"
            groupIndicator = '<img style="margin-right: 4px; position: relative; float: left; top: 4px;" src="data:image/png;base64," width="16" height="16">';
        }

        var chats = [];

        fetch('http://' + IP_ADDRESS + ':8080/GFOS/daten/chat/nutzerid/' + CURRENT_USER_ID + '/1').then(response => {
            if (response.status !== 200) {
                console.error('Code !== 200:' + response);
                return null;
            }
            response.clone();
            response.json().then(conts => {
                console.log(conts);
                document.getElementById('contactcontainer').innerHTML = '';
                for (var i=0; i<conts.length; i++) {
                    var data = conts[i];
                    var chatid = data['chatid'];
                    var isGroup = data['isgroup'];
                    if (!isGroup) groupIndicator = '';
                    //var groupIndicator = '';
                    var lastMessage = data["letztenachricht"];
                    var sender = '';
                    //var image_data = '';
                    
                    if (lastMessage == undefined) sender = '<i>Hier gibts keine Nachrichten</i>';
                    else {
                        var groupSender = '<span style="color: #48A1F4;">' + lastMessage['sender'] + ': </span>';
                        sender = (isGroup) ? groupSender : '';
                        if (lastMessage['senderid'] === CURRENT_USER_ID) sender = '<span style="color: #48A1F4;">Ich: </span>'
                        sender = sender + lastMessage['inhalt'];
                    }

                    var contextMenu = `
                    window.openInfo(` + chatid + ", '" + data["name"] + `');
                    `

                    var elem = `
                    <div onclick="window.openChat(` + chatid + ', ' + CURRENT_USER_ID + `);" class="mx-auto v-card v-sheet theme--light" style="height: 80px; max-width: 400px; background-color: rgb(23, 33, 43); border-radius: 0px;">
                        <img oncontextmenu="` + contextMenu + `" style="padding: 6px; position: relative; float: left; top: calc(50% - 32px); border-radius: 100%" src="` + image_data + `" width="64" height="64">
                        <div class="v-card__text font-weight-medium subtitle-1">
                            ` + groupIndicator + `
                            <span style="color: white;">` + data["name"] + `</span>
                            <div class="font-weight-light">
                                <span style="color: #7F91A4;">` + sender + `</span>
                            </div>
                        </div>
                    </div>
                    `;
                    document.getElementById('contactcontainer').innerHTML += elem;
                }

                /*var difference = conts.length - chats.length;
                var allSingles = document.getElementsByClassName('singlemsgcontainer');
                var scrollValue = 0; // Funktioniert, scrollt aber ein paar Pixel weiter (das doppelte?)
                for (i=allSingles.length-1; i>=difference; i--) {
                    scrollValue += allSingles[i].scrollHeight;
                }
                var count = 0;
                var id = setInterval(function() {
                    window.scrollBy(0, 5);
                    count += 15;
                    if (count > scrollValue) clearInterval(id);
                }, 16);*/

                chats = conts;
            }).catch(error => {
                console.error('An error occured while parsing the string:' + error);
            });
        });
    }
}

window.addContact = function(totalHeight) {
    console.log(totalHeight + 'px');
    EventBus.$emit('CHANGEHEIGHT', {'height': totalHeight});
}

window.openChat = function(chatid, userid) {
    window.addContact(document.getElementById('contactcontainer').clientHeight);
    console.log(chatid);
    // Open chat with given chatId
    EventBus.$emit('OPENCHAT', {'chatid': chatid, 'userid': userid});
}

window.openInfo = function(chatid, username) { // user_id or chat_id ? REMOVE USERNAME!!!
    console.log('opening profile for ' + username);
    EventBus.$emit('LOADPROFILE', {'username': username});
}
</script>
